import React from "react";
import {Button, CardColumns, Card, CardBody, CardTitle, CardImg, CardText} from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

export const PlaceComponent = function({photo, name, raiting, description, location}){
    return(
        <>
        <CardColumns
            style={{
            width: '40rem',
            display: 'flex'
            }}>
        <Card className="my-2">
            <CardImg src = {photo} width='100%'/>
            <CardBody>
            <CardTitle tag="h5">
                {name}
            </CardTitle>
            <CardText>
                {description}
            </CardText>
            <CardText>
                <small className="text-muted">
                {location}
                </small>
            </CardText>
            <CardText>
                <small className="text-muted">
                Raiting: {raiting}
                </small>
            </CardText>
            <Button>More</Button>
            </CardBody>
        </Card>
        </CardColumns>
</>

    );
}
